import ReactDOM from 'react-dom';
import { Router } from 'react-router-dom';
import App from './App';
import history from './components/History';

ReactDOM.render(
  <Router>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Router>,
  document.getElementById('root'),
);
